import { Link, Router, Switch } from "react-router-dom";

export const MenuItems = (props) => {
   const content = (
      <ul>
         {
            props.menu.map((props) =>
               <Link key={props.length()} className="linkSidebar" to={props.url}>
                  {props.value}
               </Link>
               
            )
         }
      </ul>

   );
   return (
    <Router>
      <div>
         {content}
      </div>
      </Router>);
    
};

